import React from "react";
import styled from "styled-components";

const CardEdit = styled.div`
  height: 500px;
  width: 500px;
  back
`;

const Form = styled.form``;

const Input = styled.input`
  width: 300px;
  height: 35px;
`;

function Edit() {
  return (
    <CardEdit>
      <Form>
        <Input type="text" required></Input>
      </Form>
    </CardEdit>
  );
}

export default Edit;
